import {
  AiFillInstagram,
  AiFillFacebook,
  AiFillLinkedin,
} from "react-icons/ai";

import "./Footer.scss";

const Footer = () => {
  return (
    <div className="footer-div">
      <div className="footer-contact-info">
        <AiFillFacebook
          height="35px"
          onClick={(e) => {
            e.preventDefault();
            window.open(
              "https://www.facebook.com/Tech-Start-UCalgary",
              "_blank"
            );
          }}
        />
        <AiFillInstagram
          height="100px"
          onClick={(e) => {
            e.preventDefault();
            window.open(
              "https://www.instagram.com/techstartucalgary/",
              "_blank"
            );
          }}
        />
        <AiFillLinkedin
          height="35px"
          onClick={(e) => {
            e.preventDefault();
            window.open(
              "https://www.linkedin.com/company/tech-start-ucalgary/",
              "_blank"
            );
          }}
        />
      </div>
    </div>
  );
};

export default Footer;
